description:
En route the boys feed their bellies and their hearts, meeting everyone from home bakers to Michelin-starred patissiers to learn the secrets of their baking success. They also catch up with friends and relatives to see what great home cooks produce to feed their families. As the bikers go on their freewheeling trip through Europe, they stop to cook their own dishes, inspired by the country they're visiting and the local ingredients they discover. It's the journey of a lifetime and there's a fair bit of madness thrown in as they find plenty of time to party at the locals' festivities and cultural events as well as taking in must-see sights and activities. &lt;a href=&quot;
